import React from "react";
import { useUserSession } from "../context/user-context";

const ProfileNav = () => {
  const { user } = useUserSession();

  return (
    <ul class="navbar-nav">
      <span className="navbar-text"> Welcome {user.displayName}</span>
      {!user._guest}
    </ul>
  );
};

const NavBar = () => (
  <div>
    <ProfileNav />
  </div>
);

export default NavBar;
